def max_average_path(matrix): 
    visited = set()
    current = deque()
    path = []
    for row in matrix:
        for element in row:
            if element not in visited:
                visited.add(element)
                path.append(element)
                current.append(element)
        current.popleft()
    path = [ path[i] for i in range(len(path)) ]
